def sqrt_l(N):
    x = N
    y = (x + N // x) // 2
    while(y < x):
        x = y
        y = (x + N // x) // 2
    return x


def fermat_factor(N):
    a = sqrt_l(N) + 1
    counter = 0
    X = a + counter
    Y = sqrt_l((X * X) - N)
    while((Y * Y) != ((X * X) - N)):
        counter += 1
        X = a + counter
        Y = sqrt_l((X * X) - N)

    return X+Y, X-Y


